import Layout from '../components/MyLayout.js'

export default function About() {
  return (
    <Layout style={{background: "linear-gradient(#00bf8f, #001510)"}}>
      <iframe className="video" width="853" height="480"  src="https://www.youtube.com/embed/IeMw2K9Mlbg" 
      frameborder="0" allowfullscreen ng-show="showvideo"></iframe>
    <style jsx>{`
         
            color: #000000;
            width: 100px;
            font-family: "Arial";
            text-align: center;
          }
          
          .text-style {
            margin: 20px;
          }

          input {
            margin: auto;
            width: 200px;
            text-align: center;
          }

          .description {
            font-family: "Arial";
            font-size: "10px";
          }

          ul {
            padding: 0;
          }

          li {
            list-style: none;
            margin: 5px 0;
          }

          a {
            text-decoration: none;
            color: blue;
          }

          a:hover {
            opacity: 0.6;
          }
        `}</style>
      
    </Layout>
  )
}
